import React from "react";

const Interests = () => {
  return (
    <div id="interests" class="interests">
      <h1 class="title">INTERESTS</h1>
      <p>
        Apart from being a web developer I follow a number of sci-fi and fantasy
        genre movies and television shows, and I spend a large amount of my free
        time exploring the latest technology advancements in the front-end web
        development world.
      </p>
    </div>
  );
};

export default Interests;
